import React from "react";
import GenericDivBlock from "../GenericComponents/GenericDivBlock";

const ContentRow = () => {
  return (
    <React.Fragment>
      <div className="row">
        {/* <!-- Area Chart --> */}
        <GenericDivBlock
          col="col-xl-8 col-lg-7"
          Heading="Earnings Overview"
          dropDown={{ item: "Something" }}
        />
        <GenericDivBlock
          col="col-xl-4 col-lg-5"
          Heading="Revenue Sources"
          dropDown={{}}
        />
      </div>
    </React.Fragment>
  );
};

export default ContentRow;
